import './App.css';
import React from 'react';
import Navbar from './components/Navbar';
import Home from './components/Home';
import Contact from './components/Contact'
import { Router, Route} from 'react-router-dom';


function App() {
  return (
    <>
      <Navbar />
      <Router>
        <Route path='/' exact>
          <Home />
        </Route> 
          <Contact />
      </Router>
    </>
  );
}

export default App;
